    font-weight: 500;
    color: #FFFFFF;
}

h2 {
    font-size: 2.25rem;/*36px*/
    font-weight: 400;
    padding: 50px 0;
}

h3 {
    font-weight: 700;
    font-size: 1.875rem; /*30px*/
}

h4 {
    font-family: "Open Sans", sans-serif;
    font-size: 1.5rem;/*24px*/
    font-weight: 700;
}

h5 {
    font-family: "Raleway", sans-serif;
    font-size: 1.125rem;/*18px*/
    font-weight: 400;
}

.line_under_heading{/*полоса под заголовом*/
    border: 1px solid #EC7979;
    width: calc(15% - 5px);
    margin: auto;
}








/* начало bunner_1 */

/* nav */
.bunner_1 .header {
    background: #000000;
    position: absolute;
    display: flex;
    flex-wrap: wrap;
    justify-content: space-around;
    box-sizing: border-box;
    padding: 0px 170px 0 115px;
    width: 100%;
}

.bunner_1 .logo_2 {
    display: flex;
    padding: 23px 0;
    flex-wrap: nowrap;
}

.bunner_1 nav {
    display: flex;
    width: 570px;
    justify-content: space-evenly;
}

.bunner_1 a {
    text-decoration: none;
    color: white;
    font-family: "Open Sans", sans-serif;
    font-size: 14px;
    padding: 2.28em;
    color: #FFFFFF;
}
/* nav end */


.bunner_1 {
    background: url(../images/bunner_1/bg_bunner_1.png) no-repeat center center;
    width: 100%;
    height: 1026px;
    display: flex;
    justify-content: center;
    margin: 0 auto;
    position: relative;
    background-repeat: no-repeat;
    background-size: cover;
    z-index: 1;
}

.bunner_1:before {
    content: "";
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    opacity: .5;
    z-index: -1;
    background: #000000;
}

.bunner_1 .container {
    display: flex;
    max-width: 1170px;
    width: 100%;
    justify-content: space-between;
    padding: 280px 16px 185px;
}

.bunner_1 a {
    text-decoration: none;
    color: white;
}

/* начало - box_1 - левая часть */
.bunner_1 .box_1 {
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    width: 670px;
    height: 561px;
}

.bunner_1 .logo_1 {
    display: flex;
    padding: 23px 0;
    flex-wrap: nowrap;
}

.bunner_1 .line {/*полоса под заголовом*/
    border: 1px solid #FFFFFF;
    width: calc(26% - 4px);
}

.bunner_1 .button {
    border: 2px solid #FFFFFF;
    background:rgba(51, 51, 51, 0);
    color: white;
    font-family: "Open Sans", sans-serif;
    font-weight: 600;
    font-size: 18px;
    max-width: 270px;
    width: 100%;
    height: 58px;
    cursor: pointer;
    padding: 0; 
}

.bunner_1 .button:hover {
    border: 2px solid #EC7979;
    color: #EC7979;
    
}

.bunner_1 .button:active {
    background-color: #AB4949;
    border: none;
    color: white;
}
/* конец - box_1 - левая часть*/

/* начало form - правая часть */
#form_bunner {
    display: flex;
    max-width: 470px;
    width: 100%;
    flex-wrap: wrap;
}

.bunner_1 .fieldset {
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    align-items: center;
    width: 100%;
    height: 450px;
    background: #FFFFFF;
    border: none;
    border-radius: 10px 10px 10px 10px;
    padding: 33px 0 0;
}

.bunner_1 .bold_text {
    color: #EC7979;
}

.input_bunner1 {
    display: flex;
    flex-direction: column;
    width: 100%;
    justify-content: space-between;
    align-items: center;
    height: 185px;
}

.bunner_1 input {
    border: none;
    border-bottom: 1px solid #BDBDBD;
    width: 80%;
    height: 38px;
    padding-bottom: 5px;
    font-family: "Open Sans", sans-serif;
    color: #BDBDBD;
    font-size: 14px;
    
}

.bunner_1 input:focus {
    outline: none;
    border-bottom: 2px solid black;
}

.button_5 {
    background-color: #EC7979;
    border: none;
    font-family: "Open Sans", sans-serif;
    color: white;
    font-weight: 600;
    font-size: 15px;
    width: 100%;
    height: 58px;
    cursor: pointer;
    padding: 0;
    border-radius: 0 0 10px 10px;
}

.button_5:hover {
    background-color: #AB4949;
}

.button_5:active {
    background-color: #EC7979;
    box-shadow: 0px 0px 10px 0px #AB4949 inset;
}
/* конец - form - правая часть */

.bunner_1 h5 {
    width: 270px;
    color: #FFFFFF;
}
/* конец bunner_1 */









/* начало social */
.social {
    display: flex;
    justify-content: center;
    margin: 0 auto;
    background: #F8EFEF;
    box-sizing: border-box;
    width: 100%;
}

.social .container {
    display: flex;
    flex-direction: column;
    width: 470px;
    padding-right: 30px;
}

.social .social_icons {
    display: flex;
    flex-wrap: wrap;
    width: 670px;
    justify-content: space-between;
    align-items: center;
}

.social img {
    width: 70px;
    height: 70px;
}

.social img:hover {
    transform: scale(1.2);
    transition: 0.4s;
}

.social img:active {
    transform: scale(1.3);
}

.social h4 {
    padding: 14px 0;
}

.social h5 {
    color: #86878B;
    margin: 18px 0;
}

/* конец social */











/* начало tabs */

.tabs {
    display: flex;
    flex-direction: column;
    font-family: "Open Sans", sans-serif;
    max-width: 1170px;
    width: 100%;
    margin: auto;
    padding: 100px 0px 0px;
}

.tabs .header {
    padding: 0;
    display: flex;
    justify-content: space-between;
    text-align: center;
}

.tabs .header span {
    box-sizing: border-box;
    font-size: 14px; 
    font-style: normal;
    font-weight: 400;
    padding: 10px;
}

.tabs .header .tab_1 {
    cursor: pointer;
    border: 1px solid #C6CBCD;
    border-bottom: 1px solid white;
    border-radius: 5px 5px 0 0;
    width: 18%;
}

.tabs .header .tab_2, .tab_3 {
    cursor: pointer;
    width: 16%;
    border-bottom: 1px solid #C6CBCD;
}

.tabs .header .tab_4 {
    width: 50%;
    border-bottom: 1px solid #C6CBCD;
}

.tabs .content {
    display: flex;
    border: 1px solid #C6CBCD;
    border-top: none;
    max-height: 500px;
}

.tabs .text_1 {
    display: flex;
    justify-content: space-evenly;
    flex-direction: column;
    padding: 0 30px 20px 6.25rem;
}

.tabs .button_1 {
    background-color: #EC7979;
    border: none;
    color: white;
    font-family: "Open Sans", sans-serif;
    font-weight: 600;
    font-size: 18px; 
    max-width: 270px;
    width: 100%;
    height: 58px;
    cursor: pointer;
    padding: 0;
}

.tabs .button_1:hover {
    background-color: #AB4949;
    
}

.tabs .button_1:active {
    background-color: #EC7979;
    box-shadow: 0px 0px 10px 0px #AB4949 inset;
}

.tabs #right {
    width: 29.375rem;
    max-width: 100%;
    height: auto;
}
/* конец tabs */











/* начало about */
.about {
    display: flex;
    flex-direction: column;
    align-items: center;
    font-family: "Raleway", sans-serif;
    font-style: normal;
    text-align: center;
    max-width: 1170px;
    width: 100%;
    padding: 55px 0;
}

.about header {
    display: flex;
    width: 100%;
    align-items: center;
    flex-direction: column;
    flex-wrap: wrap;

}

