    gap: 30px;
}

.about .box {
    display: flex;
    flex-direction: column;
    align-items: center;
    padding: 0;
    max-width: 370px;
}

.about img {
    max-width: 170px;
    max-height: 170px;
}

.about h4 {
    margin: 30px 0;
}
/* Конец about */












/* Начало price */

.price {
    background: #F5F5F5;
    padding: 50px 0;
    width: 100%;
}

.price .container {
    font-family: "Raleway", sans-serif;
    display: flex;
    flex-direction: column;
    font-style: normal;
    text-align: center;
    max-width: 1170px;
    width: 100%;
    margin: 0 auto;
